import React from 'react'
import axios from 'axios'

export default class Issues extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            arr: []
        }
        this.handleLoad = this.handleLoad.bind(this)
    }

    componentDidMount() {
        window.addEventListener('load', this.handleLoad)
    }

    async getIssueList() {
        await axios
            .get(
                'http://localhost:8080/virtserver.swaggerhub.com/Kodstar/Issue_Tracker/1.0.0/issues'
            )
            .then(issues => {
                this.setState({
                    arr: [...this.state.arr, issues.data]
                })
            })
    }

    render() {
        return ( <
            article > {
                this.state.arr.map(item => {
                    console.log(item.title)
                })
            } <
            /article>
        )
    }
}
